import React from 'react';
import Home from './Home'
import Map from './Map';
import './App.css';
import {BrowserRouter, Routes, Route} from "react-router-dom";




export default function App() {
  return (
      <div className = "App">
          <BrowserRouter>
        <Routes>
            <Route path = "/" exact component ={<Home/>}/>
            <Route path = "/Map" component = {<Map/>}/>
        </Routes>
          </BrowserRouter>
      </div>
  );
}
